import React from 'react';
import './css/preferences.css';
function Options() {
    return(
        <div className="options">
            <ul>
                <li className="preferenceChoice"><button type="button">Music</button></li>
                <li className="preferenceChoice"><button type="button">Shopping</button></li>
                <li className="preferenceChoice"><button type="button">Reading</button></li>
                <li className="preferenceChoice"><button type="button">Writing</button></li>
                <li className="preferenceChoice"><button type="button">Coffee</button></li>
                <li className="preferenceChoice"><button type="button">Sports</button></li>
                <li className="preferenceChoice"><button type="button">Video Games</button></li>
                <li className="preferenceChoice"><button type="button">Food</button></li>
                <li className="preferenceChoice"><button type="button">Board Games</button></li>
                <li className="preferenceChoice"><button type="button">Movies</button></li>
            </ul>
        </div>
    );
};

function Preferences() {
    return(
        <div className="preferencesPage">
            <h1>Welcome firstName lastName!</h1>
            <p>Let's get to know you better, select at least 3 of the following general interests:</p>
            <Options />
        </div>
    );
};

export default Preferences;
